CREATE TABLE "company" (
  id int primary key,
  name varchar
);

CREATE TABLE "address" (
  id int primary key,
  address_1 text,
  city text,
  state text,
  zip_code text
);

CREATE TABLE "loan" (
  id int8 primary key,
  address_id int8,
  company_id int8,
  amount float8,
  funding_date date,
  loan_term int8,
  loan_rate float8,
    CONSTRAINT fk_address FOREIGN KEY(address_id) REFERENCES address(id),
    CONSTRAINT fk_company FOREIGN KEY(company_id) REFERENCES address(id)
);

